    navigate("/");
  };

  return (
    <nav className="navbar">
      <div className="nav-links">
        <Link to="/dashboard">üè† Home</Link>
        <Link to="/leaderboard">üìä Leaderboard</Link>
      </div>
      <button onClick={handleLogout}>Logout</button>
    </nav>
  );
}
